Okay, let's break down this Ultimatum Game scenario and craft a computational model to predict responder behavior (accept/reject). Here's my thought process:

**1. Psychological Mechanisms:**

*   **Fairness/Inequity Aversion:** People don't just care about the absolute amount they receive; they care about how it compares to what the other person receives. If the offer is perceived as unfair, they might reject it, even if it means getting nothing.
*   **Proposer Intentions/Trust:** Responders might consider the proposer's intentions when deciding whether to accept. If the proposer offered a very low amount, the responder might view this as an attempt to exploit them, leading to rejection. This relates to *trust*.
*   **Loss Aversion:** People tend to feel the pain of a loss more strongly than the pleasure of an equivalent gain. A low offer might be perceived as a "loss" relative to what they feel they deserve.
*   **Reference Point/Expectations:** The responder's expectations play a role. If they expect a fair split (based on contributions, etc.), they are more likely to reject offers that fall short.
*   **Sensitivity to Earnings:** The total amount being divided likely also influences decisions; the same split percentages may be perceived differently depending on combined earnings.

**2. Interaction of Mechanisms:**

*   The perceived fairness (or unfairness) of the split is likely the dominant factor. This is influenced by the token contributions of both players.
*   Proposer intent is likely secondary, modulating the impact of fairness. A *very* unfair offer suggests a negative intent, which further decreases utility.
*   Loss aversion amplifies the negative utility of unfair offers.
*   Expectations will influence fairness judgements. I will incorporate this in the form of an interaction term with total earnings.
*   Sensitivity to earnings will be added by calculating fairness relative to total combined earnings.

**3. Mathematical Form:**

I'll start with a baseline utility based on relative fairness, then incorporate the other factors as adjustments. I'll use a simple linear combination of these factors.

**4. Parameters:**

*   *alpha*: Sensitivity to inequity. Higher values mean the responder is more sensitive to deviations from a fair split. Bound this to positive values; this is a crucial parameter that will allow for individual differences in fairness considerations.
*   *beta*: Weight given to the perception of fairness.
*   *gamma*: Sensitivity to combined earning magnitude, how much more accepting a person is for higher earning amounts, even if the split is the same.

**5. Model Variables and Observable Behavior:**

*   `token_self`, `token_opp`, `combined_earning`, `split_self`: These are the raw data.
*   I'll calculate the *fair share* based on `token_self` and `token_opp`.
*   The model predicts `accept` (0 or 1).

Here's the model specification:

```xml
<MODEL>
U = beta * (split_self - (token_self / (token_self + token_opp)) * combined_earning)  + gamma * combined_earning
</MODEL>

